&quot;Men Into Space&quot; is an American science-fiction television series broadcast from September 30, 1959 to September 7, 1960 by CBS which depicted future efforts by the United States Air Force to explore and develop outer space. The black-and-white filmed show starred William Lundigan as Col. Edward McCauley.

