The series was not set in a specific era, but clues throughout the scripts indicated that it took place in the mid-1970s to mid-1980s, with the first moon landing somewhere around 1975. Props were occasionally futuristic (such as a forerunner of today's real-life LCD TVs) but the show's earthly clothing and environs, including automobiles, telephones and other machines, were decidedly 1950s. However, a line of dialogue in &quot;Christmas on the Moon,&quot; suggests that the events of that episode take place 2,000 years after the birth of Christ.


